,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    pacjent_info SYS_REFCURSOR;',
'    v_imie VARCHAR2(50);',
'    v_nazwisko VARCHAR2(70);',
'    v_data_urodzenia DATE;',
'    v_pesel VARCHAR2(50);',
'    v_numer_telefonu VARCHAR2(50);',
'    v_uprawnienia_id INTEGER;',
'    v_ulica VARCHAR2(50);',
'    v_nr_lokalu VARCHAR2(50);',
'    v_miasto VARCHAR2(50);',
'    v_wojewodztwo VARCHAR2(50);',
'    l_result VARCHAR2(4000); -- Adjust the length as needed',
'BEGIN',
'    pacjent_info := Pakiet_1.Pobierz_Informacje_Pacjent(:P2_SEARCH);',
'',
'    FETCH pacjent_info INTO',
'        v_imie,',
'        v_nazwisko,',
'        v_data_urodzenia,',
'        v_pesel,',
'        v_numer_telefonu,',
'        v_uprawnienia_id,',
'        v_ulica,',
'        v_nr_lokalu,',
'        v_miasto,',
'        v_wojewodztwo;',
'',
'    -- Check if the fetch was successful',
'    IF pacjent_info%FOUND THEN',
unistr('        l_result := ''Imi\0119: '' || v_imie || CHR(10) || '),
'        ''Nazwisko: '' || v_nazwisko || CHR(10) || ',
'        ''Data urodzenia: '' || v_data_urodzenia || CHR(10) ||',
'        ''PESEL: '' || v_pesel || CHR(10) ||',
'        ''Numer telefonu: '' || v_numer_telefonu || CHR(10) ||',
'        ''Adres: '' || '' '' || v_ulica || '' '' || v_nr_lokalu || '' '' || v_miasto || '' '' || v_wojewodztwo;',
'    ELSE',
'        l_result := ''Brak danych dla podanego identyfikatora.'';',
'    END IF;',
'',
'    :P2_RESULT := l_result;',
'',
'    CLOSE pacjent_info;',
'EXCEPTION',
'    WHEN OTHERS THEN',
unistr('        :P2_RESULT := ''B\0142\0105d: '' || SQLERRM;'),
'        CLOSE pacjent_info;',
'END;'))
,p_attribute_02=>'P2_SEARCH'
